import React from "react";

/* Importar los componentes */

/* Importar los iconos */
import video from "../icons/iconfinder_ic_videocam_48px_3669181.png";

export default function Navbar(props) {
  return (<div className="navbar">
    <div className="logo"> <img src={props.logo} alt="logo" /> </div>
    <div className="search-bar"></div>
    <div className="icon"> <img src={props.video} alt="video" /> </div>
    <div className="icon"> <img src={props.logo} alt="logo" /> </div>
    <div className="icon"> <img src={props.logo} alt="logo" /> </div>
    <div className="login"> </div>
  </div>)
}
